■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>スッキリとした口当たりのおいしい国産青汁。</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="610" valign="top" align="center"><div><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5351/1032636-01.jpg" width="600" height="510"><br><font size=3></font></div><br><table width="600" border="0" align="center" cellpadding="5" cellspacing="1" bgcolor="#999999"><tr><td bgcolor="#FFFFCC"><table width="100%" border="0" cellpadding="3" cellspacing="0"><tr><th><font color="#FF0000">------&nbsp;ココがポイント！&nbsp;------</font></th></tr><tr><td><strong><font size="3" color="#FF9900">●国産の大麦若葉に食物繊維、オリゴ糖、乳酸菌を配合。</font></strong></td></tr><tr><td><strong><font size="3" color="#FF9900">●1袋3g当たり、3億個の乳酸菌を配合!!</font></strong></td></tr><tr><td><strong><font size="3" color="#FF9900">●さっぱりとした味わいで、お茶代わりにごくごく飲んでいただけます♪</font></strong></td></tr></table></td></tr></table><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><font size="3">【お召し上がり方】<br>1日1～2袋を目安に、1袋を80～100cc程度の水またはぬるま湯、牛乳等に溶かしてお召し上がりください。<br><br>【保存方法】<br>・高温多湿、直射日光を避け、涼しいところに保存してください。<br>・個包装開封後は、保存せずに1度にお召し上がりください。<br><br>【注意】<br>・本品は農産物を使用しておりますので、収穫時期などにより色・味・香りなどにバラツキがございますが、品質には問題ありません。<br>・体に合わない時は、ご使用をおやめください。<br><br>【販売者】<br>株式会社　ユニマットリケン<br>東京都港区南青山2-7-28</font></td></tr></table><br><br><table width="600" cellspacing="0" cellpadding="0" border="0" align="center"></table></td></tr></table><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><br><font size="3">国産の大麦若葉に食物繊維、オリゴ糖、乳酸菌を配合した、スッキリとした口当たりのおいしい青汁です。1袋当り3億個の乳酸菌が摂取できます。</font></td></tr></table><br><!--栄養成分・原材料表ここから--><table width="600" border="0" align="center" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" bgcolor="#FFFFCC"><font color="#333333" size="-1">栄養成分</font></td><td width="75%"><font color="#333333" size="-1">(1袋3g当たり)<br>エネルギー:10.38kcal、たんぱく質:0.14g、脂質:0.02g、糖質:2.14g、食物繊維:0.52g、ナトリウム:2.1mg、乳酸菌:3億個</font></td></tr><tr bgcolor="#FFFFFF"><td width="25%" bgcolor="#FFFFCC"><font color="#333333" size="-1">原材料</font></td><td width="75%"><font color="#333333" size="-1">大麦若葉、難消化性デキストリン、ポリデキストロース、オリゴ糖、香煎、カキガラ末、クロレラ原末、緑葉野菜混合末(大麦若葉、ケール、デキストリン、ブロッコリー、ホウレンソウ、セロリ、パセリ、キャベツ、シソ、ヨモギ)、乳酸菌末、ソルビトール</font></td></tr></table><br><!--栄養成分・原材料表ここまで--><span style="padding:0;margin:0;font-size:0;color:#fff;">fk094igrjs</span><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">国産の大麦若葉に食物繊維、オリゴ糖、乳酸菌を配合した、スッキリとした口当たりのおいしい青汁です。1袋当り3億個の乳酸菌が摂取できます。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">内容量</font></td><td width="75%" align="left"><font color="#333333" size="-1">90g(3g×30袋)</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">個装サイズ：21×18×4cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">個装重量：135g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">名称：大麦若葉加工食品</font><br> <font color="#333333" size="-1">賞味期間：製造日より720日</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
