■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>牛乳や豆乳に合う混ぜるのがオススメの抹茶風味の青汁!</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="610" valign="top" align="center"><div><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5335/1023710-01.jpg" width="600" height="600"><br><font size=3></font></div><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><font size="3">【お召し上がり方】<br>●1日に1包(3g)を目安に、80～100mL程度の水又は牛乳等の飲み物によく混ぜてお召し上がりください。<br>※市販のシェイカーを使いますと、よく混ざります。<br>※粉末のままお召し上がりいただくと、のどに詰まる恐れがございます。必ず水又は、飲料に溶かしてお召し上がりください。<br><br>【保存方法】<br>高温多湿を避け、直射日光の当らない場所に保存してください。<br><br>【注意事項】<br>●開封後はなるべく早めにお召し上がりください。<br>●大麦に含まれる葉緑素は、光や熱により退色しますので保存方法にご注意下さい。<br>●飲料に溶かした際には成分が沈殿・浮遊する場合がございますが、品質に問題はございません。<br>●体調に合わないと思われる時は、すぐに摂取をお止めください。<br>●摂取後、湿疹等の異常が見られた時は、すぐに摂取をお止めになり医師の診察を受けてください。<br>●乳幼児の手の届かない所に保管してください。<br>●本品は多量摂取により疾病が治癒したり、より健康が増進するものではございません。1日の摂取目安量を守ってください。<br>●妊娠中、授乳中の方は医師に相談の上、お召し上がりください。<br>●薬を服用中の方、疾病等をお持ちの方、通院中の方は医師に相談の上、お召し上がりください。<br>※アルミ分包の柄、形状が変更になる場合がございますが、品質には問題ありません。<br><br>【販売元】<br>株式会社ユーワ<br>東京都武蔵村山市伊奈平市1-51-2</font></td></tr></table><br><br><table width="600" cellspacing="0" cellpadding="0" border="0" align="center"></table></td></tr></table><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><br><font size="3">大麦若葉には、カルシウムやカリウム、食物繊維などが含まれています。日常の食生活の補助として、不足しがちな栄養補給に!国産大麦若葉を従来品よりもさらに溶けやすく、飲みやすくしました。野菜が苦手な方やお子様でもお召し上がりいただけます。</font></td></tr></table><br><!--栄養成分・原材料表ここから--><table width="600" border="0" align="center" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" bgcolor="#FFFFCC"><font color="#333333" size="-1">栄養成分</font></td><td width="75%"><font color="#333333" size="-1">【1包(3g)当たり】<br>熱量:10.05kcal、たんぱく質:0.195g、脂質:0.03g、糖質:2.043g、食物繊維:0.42g、ナトリウム:0.27mg、カルシウム:3.6mg、カリウム:23.1mg、β-カロテン:69μg、ビタミンK:9.3μg</font></td></tr><tr bgcolor="#FFFFFF"><td width="25%" bgcolor="#FFFFCC"><font color="#333333" size="-1">原材料</font></td><td width="75%"><font color="#333333" size="-1">大麦若葉末、マルトデキストリン、ぶどう糖、難消化性デキストリン</font></td></tr></table><br><!--栄養成分・原材料表ここまで--><span style="padding:0;margin:0;font-size:0;color:#fff;">fk094igrjs</span><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">大麦若葉には、カルシウムやカリウム、食物繊維などが含まれています。日常の食生活の補助として、不足しがちな栄養補給に!国産大麦若葉を従来品よりもさらに溶けやすく、飲みやすくしました。野菜が苦手な方やお子様でもお召し上がりいただけます。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">内容量</font></td><td width="75%" align="left"><font color="#333333" size="-1">300g(3g×100包)</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">個装サイズ：23×11×14cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">個装重量：504g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">商品区分：健康食品</font><br><font color="#333333" size="-1">名称：大麦若葉加工食品</font><br><font color="#333333" size="-1">賞味期間：製造日より1,260日</font><br> </td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><!--ab-->